import { Link } from 'react-router-dom'
import logo from './resources/pitch_logo.png'

const Navbar = () => {
    return (  
        <nav className="navbar">
            <div className="links">
                <Link to="/">מגרשים</Link>
                <Link to="/create">הוספת מגרש</Link>
            </div>
            <img src={logo} alt="logo of company"/>
        </nav>
    );
}
 
export default Navbar;
